pragma solidity 0.6.6;
pragma experimental ABIEncoderV2;

interface CarCollectible{
    struct Attr {
        string brand;
        string model;
        uint16 year;
        uint32 price;
        uint16 iot_account;
    }
    function check_ownership(uint256 tokenId) external view returns (address);
    function get_attributes(uint256 tokenId) external view returns(Attr memory attr);
}

interface APIConsumer{
    function code() external view returns (uint256);
}

contract Insurance{

    struct Policy {
        uint256 tokenID;
        string brand;
        string model;
        uint16 year;
        uint32 price;
        uint16 iot_account;
        uint256 purchase;

    }

    CarCollectible public cc_address;
    CarCollectible.Attr attr;

    APIConsumer public chainlink;

    address sender;

    constructor () public
    {
        cc_address = CarCollectible(0x2f7eD018Da8D9643634E2EE65B455D990ad6D3Ba);
        chainlink = APIConsumer(0x2997f7DACe6f383841798B1a087D4424459AD02b);
    }

    function set_sender() external
    {
        sender = msg.sender;
    }

     function check_ownership(uint256 tokenId) external view returns (bool)
     {
        address owner = cc_address.check_ownership(tokenId);
        if(owner==sender) {
            return true; 
        } else {
            return false;
        }
        //return sender;
     }

    function get_metadata(uint256 tokenId) external view returns (CarCollectible.Attr memory attr)
    {
        return cc_address.get_attributes(tokenId);
    }

    function get_weather() external view returns (uint256) {
        return chainlink.code();
    }

    function get_premium() external view returns (uint256) {
        return 300000000000000000;
    }

}
